import logo from './logo.svg';
import './App.css';

const blockRand = [
  {
    number: 1,
    color: '#2c88d9',
    position: 'col-6',
    height: 400
  },
  {
    number: 2,
    color: '#d3455b',
    position: 'col-6',
    height: 400
  },
  {
    number: 3,
    color: '#897a5f',
    position: 'col-3',
    height: 400
  },
  {
    number: 4,
    color: '#ac6363',
    position: 'col-3',
    height: 400
  },

  {
    number: 5,
    color: '#763ec3',
    position: 'col-3',
    height: 400
  },
  {
    number: 6,
    color: '#53af9f',
    position: 'col-3',
    height: 400
  },
  {
    number: 7,
    color: '#387968',
    position: 'col-3',
    height: 400
  },
  {
    number: 8,
    color: '#6558f5',
    position: 'col-6',
    height: 400
  },
  {
    number: 9,
    color: '#4b5c6b',
    position: 'col-3',
    height: 400
  }
]

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="masonry_container">
          { blockRand.map((b) => {
            return (
              <div className={'item'} >
                <div style={{background: b.color, height: b.height}}>
                  {b.number}
                </div>
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
